The previous models primarily focus on variations of self-interest and fairness considerations.  However, they lack exploration of potential social comparison effects.  Responders might not only compare their share to their contribution but also compare their share to the opponent's share, especially considering the opponent's contribution.  This comparison could be influenced by their own contribution relative to the opponent's.  A simple model capturing this could be a weighted combination of self-interest and a relative advantage calculation.

The relative advantage calculation considers the difference between the responder's percentage share and the opponent's percentage share, further modulated by the ratio of the responder's tokens to the opponent's tokens. A larger ratio would increase the weight given to this relative advantage.

This model incorporates two learnable parameters: one for the weight given to self-interest and one for the weight given to the relative advantage.  It avoids high covariance by decoupling these parameters from other fairness considerations such as absolute equity.

