def simulate_model(trial_data, self_interest_weight=1, relative_advantage_weight=1):
    utility_values = []
    for trial in trial_data:
        try:
            split_self = trial['split_self']
            splitperc_self = trial['splitperc_self']
            splitperc_opp = trial['splitperc_opp']
            token_self = trial['token_self']
            token_opp = trial['token_opp']

            #Handle division by zero
            if token_opp == 0:
                relative_advantage = 0
            else:
                relative_advantage = (splitperc_self - splitperc_opp) * (token_self / token_opp)

            utility = self_interest_weight * split_self + relative_advantage_weight * relative_advantage
            utility_values.append(utility)
        except KeyError as e:
            print(f"Error processing trial: Missing key {e}. Skipping trial.")
            utility_values.append(float('nan')) #add nan for missing values.

    return utility_values
